import ExpenseItem from './ExpenseItem';

const Expense = ({expenses}) => {
    return (
        <div>
        

            <ExpenseItem 
                id={expense[0].id}
                title={expense[0].title}
                amount={expense[0].amount}
                date={expense[0].date}
            />
        </div>  

    )
}

export default Expense;
